var letters = range('A','Z');
var personCount = 50000;

var persons = [];
for (var j=1; j<=personCount; j++) {
	var rand1 = Math.random();
	var rand2 = Math.random();
	var id = 10000000 + Math.floor(rand1 * 89999999) + letters[Math.floor(rand2 * letters.length)];
  var name = names[Math.floor(rand1 * names.length)];
	var surname = surnames[Math.floor(rand2 * surnames.length)];
	var age = 18 + Math.floor(rand1 * 70);
	var person = { _id: id, name: name, surname: surname, age: age };
	persons.push(person);
}
for (var j=0; j<personCount; j++) {
	var rand1 = Math.random();
	var rand2 = Math.random();
	var friendsCount = 10 + Math.floor(rand1 * 20);
	var friends = [];
	for (var i=1; i<=friendsCount; i++) {
		friend = persons[Math.floor(Math.random() * personCount)];
		if (friend._id != persons[j]._id) {
			friends.push(friend._id);
		}
	}
	persons[j].friends = friends;
	printjson(persons[j]);
}
var restaurants = [];
for (var j=0; j<restaurant_names.length; j++) {
	var rand1 = Math.random();
	var rand2 = Math.random();
	var cuisine = cuisines[Math.floor(rand1 * cuisines.length)];
	var price_level = 1 + Math.floor(rand2 * 5);
	var restaurant = { name: restaurant_names[j], cuisine: cuisine, level: price_level };
	var clientsCount = 3 + Math.floor(Math.random() * 20);
	var clients = [];
	for (var i=1; i<=clientsCount; i++) {
		client = persons[Math.floor(Math.random() * personCount)];
		valoracion = { id: client._id, rate: Math.floor(Math.random() * 10) };
		clients.push(valoracion);
	}
	restaurant.clients = clients;
	restaurants.push(restaurant);
	printjson(restaurant);
}

db.clients.insertMany(persons);
